import React, { useState } from 'react';
import './index.css';
const state = useState();
console.log(state);

let count = 0;

function NumIncrement(){
  console.log(count++);
}


function App(){

    return (
        <React.Fragment>        
        <h1 >{count}</h1>
        <button onClick={NumIncrement}>Click Me</button>
      </React.Fragment>
    )
}

export default App;
